window.bookSummaryJSON = "<p>Contains a prequel novella and book 2 of The Captive series.</p> <p>As the most notorious, sadistic drug lord on the West Coast, I thrive on power and control. Valentina loathes me as much as I despise her. That doesn't stop me from kidnapping her, stealing her away for myself.</p> <p>Over the years that have separated us, hatred has festered in my heart. The girl I once loved is all woman now, and she thinks she belongs to someone else.</p> <p>Her defiance tempts and torments me, and I'll never tire of devising devious punishments to keep her in line. She can't escape my cruel touch and harsh discipline. No one will take her from me. I'll kill anyone who tries.</p> <p>I will possess Valentina, body and soul. </p>"; 
